import { getList } from "../../api/admin/company.js";
import { mapGetters } from "vuex";
export default {
    data() {
        return {
            listLoading: false,
            dialogFormVisible: false,
            list: [],
            form: {
                name: "",
                address: "",
                duty: "",
                bankName: "",
                bankNumber: ""
            },
            company_btn_add: false,
            number: "",
            width: {
                type: String,
                default: "80%"
            }
        };
    },
    created() {
        this.getCompanyList();
        this.company_btn_add = this.permissions["sys_company_add"];
    },
    computed: {
        ...mapGetters(["permissions"])
    },
    methods: {
        getCompanyList() {
            this.loading = true;
            getList(null)
                .then(response => {
                    this.loading = false;
                    this.list = response.data.data;
                    console.log(this.list);
                    this.number = this.list.length;
                })
                .catch(() => {
                    this.loading = false;
                });
        },
        submit() {
            var that = this;
            that.dialogFormVisible = false;
            that.users.push({
                ...that.form
            });
        }
    },
    mounted() {}
};
